import React, { useState } from "react";
import "../App.css";
import ProjectCodeSnippet from "./ProjectCodeSnippet";  // Assume this is a component displaying code or images.

function ProjectsDisplay() {
    const [activeProject, setActiveProject] = useState("project1");

    const projects = {
        project1: {
            name: "E-commerce System",
            content: "path/to/ecommerce-system.jpg"  // Assuming this is an image; it could also be a code snippet.
        },
        project2: {
            name: "Mobile App",
            content: "path/to/mobile-app.jpg"
        },
        project3: {
            name: "Machine Learning Model",
            content: "path/to/machine-learning-model.jpg"
        },
        project4: {
            name: "Data Visualization Project",
            content: "path/to/data-visualization.jpg"
        }
    };

    return (
        <div className="projects-container" id="projects">
            <div className="projects-list">
                {Object.keys(projects).map(key => (
                    <button
                        key={key}
                        onClick={() => setActiveProject(key)}
                        className={`project-item ${activeProject === key ? 'active' : ''}`}
                    >
                        {projects[key].name}
                    </button>
                ))}
            </div>
            <div className="project-content">
                <ProjectCodeSnippet imageSrc={projects[activeProject].content} />
            </div>
        </div>
    );
}

export default ProjectsDisplay;
